query PostQuery(
  $slug: String!
) {
  markdownRemark(frontmatter: {slug: {eq: $slug}}) {
    html
    frontmatter {
      title
      date
      slug
    }
  }
}

sq--src-components-archive-js.query:
query BlogPostArchive {
  allMarkdownRemark(limit: 3, sort: {order: DESC, fields: [frontmatter___date]}) {
    totalCount
    edges {
      node {
        excerpt
        frontmatter {
          title
          slug
          date(formatString: "MMMM DD, YY")
        }
      }
    }
  }
}

sq--src-components-listing-js.query:
query BlogPostListing {
  allMarkdownRemark(limit: 10, sort: {order: DESC, fields: [frontmatter___date]}) {
    edges {
      node {
        excerpt
        frontmatter {
          date(formatString: "MMMM DD, YYYY")
          title
          slug
        }
      }
    }
  }
}

sq--src-components-layout-js.query:
query SiteTitleQuery {
  site {
    siteMetadata {
      title
      description
    }
  }
  file(relativePath: {regex: "/bg/"}) {
    childImageSharp {
      fluid(maxWidth: 1000) {
        ...GatsbyImageSharpFluid_tracedSVG
      }
    }
  }
}

fragment GatsbyImageSharpFluid_tracedSVG on ImageSharpFluid {
  tracedSVG
  aspectRatio
  src
  srcSet
  sizes
}
